import React from 'react';
import styled from 'styled-components';
import colors from '../constants/colors';

const StyledDiv = styled.div`
    max-width: 700px;
    min-width: 300px;
    width: 100%;
    border-radius: 10px;
    overflow: hidden;
`;
const StyledHeader = styled.div`
    width: 100%;
    height: 50px;
    background-color: ${colors.main};
    line-height: 50px;
    text-align: center;
    color: ${colors.text};
    font-size: 18px;
    border-radius: 10px 10px 0 0;
`;
const StyledFooter = styled.div`
    width: 100%;
    height: 50px;
    background-color: ${colors.main};
    border-radius: 0 0 10px 10px;
`;
const StyledColumn = styled.div`
    height: 100%;
`;

const ForksList = ({forks}) => (
    <StyledDiv>
        <StyledHeader>
            <StyledColumn style={{width: '30%'}}>Author</StyledColumn>
            <StyledColumn style={{width: '40%'}}>Repository Name</StyledColumn>
            <StyledColumn style={{width: '15%'}}>Stars</StyledColumn>
            <StyledColumn style={{width: '15%'}}>Link</StyledColumn>
        </StyledHeader>

        <StyledFooter></StyledFooter>
    </StyledDiv>
);

export default ForksList;
